INSERT INTO `wechat_cp_article` VALUES ('5a9ec0424e5adca4014e62a839eb0000', '2', '4', '今日起至8月底近2个月的时间，三环线青菱立交上下桥匝道依次交替全封闭进行维修工程施工，市交管部门在提前发布管制信息的同时，根据不同交替封闭施工的时段给出绕行建议，为在施工管制期间需要驾车途径该区域的市民有效避堵而出谋划策。交替全封闭施工的时间和具体交通管制措施    三环线青菱立交位于洪山区，是连接白沙洲大桥、白沙洲大道、三环线南段和国道107的重要互通立交。匝道维修施工期间，将对青菱立交的车辆通行造成一定的影响，施工总工期为近2个月时间。施工期间，青菱立交上下桥匝道将依次进行全封闭维修工程施工，每条匝道封闭工期为15天。管制时间为2015年7月3日至2015年8月31日。为满足市民的基本出行需求，交管部门制定了相应的临时管制措施：    2015年7月3日至2015年7月17日，三环线青菱立交D2匝道（白沙洲大桥往武昌火车站方向）与B匝道（野芷湖往青郑高速方向）禁止机动车通行。    2015年7月18日至2015年8月1日，三环线青菱立交D1匝道（白沙洲大桥往郑店方向）与A匝道（野芷湖往武昌火车站方向）禁止机动车通行。    2015年8月2日至2015年8月16日，三环线青菱立交C2匝道（青郑高速往白沙洲大桥方向）与E匝道（武昌火车站往野芷湖方向）禁止机动车通行。    2015年8月17日至2015年8月31日，三环线青菱立交C1匝道（武昌火车站往白沙洲大桥方向）与F匝道（青郑高速往野芷湖方向）禁止机动车通行。交警根据管制时间给出不同绕行建议    由于此次施工是交替依次对不同的上线桥匝道进行封闭施工，所以在不同的管制时间行车线路有变化。为此，交警给出不同管制时间的绕行建议助市民有效避堵出行。    D2匝道（白沙洲大桥往武昌火车站方向绕行建议）：    经由白沙洲大桥左转去往武昌火车站方向的车辆，提前在梅子立交、鹦鹉立交转向，通过江城大道、鹦鹉大道，行至鹦鹉洲大桥进行绕行（图1）。    B匝道（野芷湖往青郑高速方向绕行建议）：    三环线野芷湖左转去往青郑高速方向的车辆，提前在野芷湖立交地面环岛转向，通过文化大道、星光大道进行绕行（图2）。    D1匝道（白沙洲大桥往青郑高速方向绕行建议）：    经由白沙洲大桥右转去往青郑高速方向的车辆，可提前在梅子立交、鹦鹉立交转向，通过江城大道、鹦鹉大道，行至鹦鹉洲大桥进行绕行；其中，需通行青郑高速的过境车辆可提前在梅子立交、鹦鹉立交转向，通过汉洪高速、武汉绕城高速（沪蓉高速）进行绕行（图3）。        A匝道（野芷湖往武昌火车站方向绕行建议）：    三环线野芷湖右转去往武昌火车站方向的车辆，提前在关山一路立交、苗山立交以及野芷湖立交地面环岛转向，通过关山大道、民族大道、珞狮南路以及雄楚大道等相关到进行绕行（图4）。    C2匝道（青郑高速往白沙洲大桥方向绕行建议）：    国道107（青郑高速）左转去往白沙洲大桥方向的车辆，提前通过武汉绕城高速（沪蓉高速）、汉洪高速进行绕行或经由白沙洲大道高架通过鹦鹉洲大桥完成过江出行需求（图5）。    E匝道（武昌火车站往野芷湖方向绕行建议）：    武昌火车站左转去往野芷湖方向的车辆，提前通过武珞路、雄楚大道转向，绕行至二环线（珞狮南路段）（图6）。    C1匝道（武昌火车站往白沙洲大桥方向绕行建议）：    武昌火车站右转去往白沙洲大桥方向的车辆，提前通过大东门立交、梅家山立交转向，经由长江大桥、鹦鹉洲大桥实现过江出行需求（图7）。    F匝道（青郑高速往野芷湖方向绕行建议）：    青郑高速右转去往野芷湖方向的车辆，提前在江夏区通过金龙大道、星光大道转向，通过文化大道进行绕行或经由白沙洲大道高架通过雄楚大道高架完成原转向出行需求（图8）。    交警提醒：此次为期近2个月的封闭施工，分4个时间段8个上下匝道依次交替进行临时交通管制，每个管制期间均封闭2个匝道，且是禁止机动车通行管制区域的，所以请市民一定根据不同的管制时间来制定不同的行驶线路来完成通行，不要因忽视管制时间、地点而导致贸然闯关。', null, null, null, '<p style=\"text-align:justify\">今日起至8月底近2个月的时间，三环线青菱立交上下桥匝道依次交替全封闭进行维修工程施工，市交管部门在提前发布管制信息的同时，根据不同交替封闭施工的时段给出绕行建议，为在施工管制期间需要驾车途径该区域的市民有效避堵而出谋划策。</p>\r\n\r\n<p style=\"text-align:center\"><strong>交替全封闭施工的时间和具体交通管制措施</strong></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 三环线青菱立交位于洪山区，是连接白沙洲大桥、白沙洲大道、三环线南段和国道107的重要互通立交。匝道维修施工期间，将对青菱立交的车辆通行造成一定的影响，施工总工期为近2个月时间。施工期间，青菱立交上下桥匝道将依次进行全封闭维修工程施工，每条匝道封闭工期为15天。管制时间为2015年7月3日至2015年8月31日。为满足市民的基本出行需求，交管部门制定了相应的临时管制措施：</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 2015年7月3日至2015年7月17日，三环线青菱立交D2匝道（白沙洲大桥往武昌火车站方向）与B匝道（野芷湖往青郑高速方向）禁止机动车通行。<br />\r\n&nbsp;&nbsp;&nbsp; 2015年7月18日至2015年8月1日，三环线青菱立交D1匝道（白沙洲大桥往郑店方向）与A匝道（野芷湖往武昌火车站方向）禁止机动车通行。<br />\r\n&nbsp;&nbsp;&nbsp; 2015年8月2日至2015年8月16日，三环线青菱立交C2匝道（青郑高速往白沙洲大桥方向）与E匝道（武昌火车站往野芷湖方向）禁止机动车通行。<br />\r\n&nbsp;&nbsp;&nbsp; 2015年8月17日至2015年8月31日，三环线青菱立交C1匝道（武昌火车站往白沙洲大桥方向）与F匝道（青郑高速往野芷湖方向）禁止机动车通行。</p>\r\n\r\n<p style=\"text-align:center\"><strong>交警根据管制时间给出不同绕行建议</strong></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 由于此次施工是交替依次对不同的上线桥匝道进行封闭施工，所以在不同的管制时间行车线路有变化。为此，交警给出不同管制时间的绕行建议助市民有效避堵出行。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; <strong>D2匝道（白沙洲大桥往武昌火车站方向绕行建议）：</strong></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 经由白沙洲大桥左转去往武昌火车站方向的车辆，提前在梅子立交、鹦鹉立交转向，通过江城大道、鹦鹉大道，行至鹦鹉洲大桥进行绕行（图1）。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://www.whjg.gov.cn/Portals/0/new_images/%E5%9B%BE1.png\" style=\"border:0px none; vertical-align:top\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; <strong>B匝道（野芷湖往青郑高速方向绕行建议）：</strong></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 三环线野芷湖左转去往青郑高速方向的车辆，提前在野芷湖立交地面环岛转向，通过文化大道、星光大道进行绕行（图2）。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://www.whjg.gov.cn/Portals/0/new_images/%E5%9B%BE2.png\" style=\"border:0px none; vertical-align:top\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; <strong>D1匝道（白沙洲大桥往青郑高速方向绕行建议）：</strong></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 经由白沙洲大桥右转去往青郑高速方向的车辆，可提前在梅子立交、鹦鹉立交转向，通过江城大道、鹦鹉大道，行至鹦鹉洲大桥进行绕行；其中，需通行青郑高速的过境车辆可提前在梅子立交、鹦鹉立交转向，通过汉洪高速、武汉绕城高速（沪蓉高速）进行绕行（图3）。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://www.whjg.gov.cn/Portals/0/new_images/%E5%9B%BE3.png\" style=\"border:0px none; vertical-align:top\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; <strong>A匝道（野芷湖往武昌火车站方向绕行建议）：</strong></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 三环线野芷湖右转去往武昌火车站方向的车辆，提前在关山一路立交、苗山立交以及野芷湖立交地面环岛转向，通过关山大道、民族大道、珞狮南路以及雄楚大道等相关到进行绕行（图4）。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://www.whjg.gov.cn/Portals/0/new_images/%E5%9B%BE4.png\" style=\"border:0px none; vertical-align:top\" /></p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\">&nbsp;&nbsp;&nbsp; <strong>C2匝道（青郑高速往白沙洲大桥方向绕行建议）：</strong></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 国道107（青郑高速）左转去往白沙洲大桥方向的车辆，提前通过武汉绕城高速（沪蓉高速）、汉洪高速进行绕行或经由白沙洲大道高架通过鹦鹉洲大桥完成过江出行需求（图5）。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://www.whjg.gov.cn/Portals/0/new_images/%E5%9B%BE5.png\" style=\"border:0px none; vertical-align:top\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; <strong>E匝道（武昌火车站往野芷湖方向绕行建议）：</strong></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 武昌火车站左转去往野芷湖方向的车辆，提前通过武珞路、雄楚大道转向，绕行至二环线（珞狮南路段）（图6）。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://www.whjg.gov.cn/Portals/0/new_images/%E5%9B%BE6.png\" style=\"border:0px none; vertical-align:top\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; <strong>C1匝道（武昌火车站往白沙洲大桥方向绕行建议）：</strong></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 武昌火车站右转去往白沙洲大桥方向的车辆，提前通过大东门立交、梅家山立交转向，经由长江大桥、鹦鹉洲大桥实现过江出行需求（图7）。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://www.whjg.gov.cn/Portals/0/new_images/%E5%9B%BE7.png\" style=\"border:0px none; vertical-align:top\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; <strong>F匝道（青郑高速往野芷湖方向绕行建议）：</strong></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 青郑高速右转去往野芷湖方向的车辆，提前在江夏区通过金龙大道、星光大道转向，通过文化大道进行绕行或经由白沙洲大道高架通过雄楚大道高架完成原转向出行需求（图8）。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://www.whjg.gov.cn/Portals/0/new_images/%E5%9B%BE8.png\" style=\"border:0px none; vertical-align:top\" /></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><strong>&nbsp;&nbsp;&nbsp; 交警提醒：</strong>此次为期近2个月的封闭施工，分4个时间段8个上下匝道依次交替进行临时交通管制，每个管制期间均封闭2个匝道，且是禁止机动车通行管制区域的，所以请市民一定根据不同的管制时间来制定不同的行驶线路来完成通行，不要因忽视管制时间、地点而导致贸然闯关。</p>\r\n', '2015-07-06 17:17:48', '1', '11', '今起 青菱立交匝道交替封闭施工近2个月', '1', '2015-07-06 17:17:58', '1');
INSERT INTO `wechat_cp_article` VALUES ('5a9ec0424e5adca4014e62aa0eb10002', '4', '4', '2015年7月11日至2015年8月10日，金龙路（汉阳大道至玫瑰街）将全封闭进行道路维修施工。根据《中华人民共和国道路交通安全法》等法律法规的规定，现将该路段施工期间有关道路交通管理事项通告如下：    一、金龙路（汉阳大道至玫瑰街）禁止机动车通行。    二、需通行施工路段的机动车，可绕行龙阳大道、玫瑰南街、玉龙路、银杏街等相关道路。    三、施工路段上的公交营运线路的调整，按照《武汉市城市公共客运交通管理条例》的规定，另行通告。    四、机动车驾驶人应服从交通警察及现场管理人员的指挥，按照交通标志的指示通行。    五、违反本通告的，公安机关交通管理部门将依照《中华人民共和国道路交通安全法》等有关法律、法规的规定，予以处罚。    特此通告。', null, null, null, '<p style=\"text-align:justify\">2015年7月11日至2015年8月10日，金龙路（汉阳大道至玫瑰街）将全封闭进行道路维修施工。根据《中华人民共和国道路交通安全法》等法律法规的规定，现将该路段施工期间有关道路交通管理事项通告如下：</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 一、金龙路（汉阳大道至玫瑰街）禁止机动车通行。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 二、需通行施工路段的机动车，可绕行龙阳大道、玫瑰南街、玉龙路、银杏街等相关道路。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 三、施工路段上的公交营运线路的调整，按照《武汉市城市公共客运交通管理条例》的规定，另行通告。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 四、机动车驾驶人应服从交通警察及现场管理人员的指挥，按照交通标志的指示通行。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 五、违反本通告的，公安机关交通管理部门将依照《中华人民共和国道路交通安全法》等有关法律、法规的规定，予以处罚。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 特此通告。</p>\r\n', '2015-07-06 17:19:48', null, '3', '关于金龙路（汉阳大道至玫瑰街）道路维修工程施工期间交通管理的通告', null, '2015-07-06 17:19:54', '1');
INSERT INTO `wechat_cp_article` VALUES ('5a9ec0424e5adca4014e62adac7f0003', '3', '4', '2015年7月4日至2015年8月30日，中山大道（南京路至黄石路）将全封闭进行地铁区间工程施工。为保障施工路段周边道路安全、畅通和施工顺利进行，根据《中华人民共和国道路交通安全法》等法律法规的规定，现将该路段施工期间有关道路交通管理事项通告如下：    一、中山大道（南京路至黄石路）禁止机动车通行。    二、保华街（黄石路至南京路）临时调整为双向通行。    三、需通行施工路段的机动车，可绕行江汉二路、吉庆街、保华街、南京路、崇善路等相关道路。    四、通行施工路段公交线路的调整，按照《武汉市城市公共客运交通管理条例》的规定，另行通告。    五、机动车驾驶人应服从交通警察及现场管理人员的指挥，按照交通标志的指示通行。    六、违反本通告的，公安机关交通管理部门将依照《中华人民共和国道路交通安全法》等有关法律、法规的规定，予以处罚。    特此通告。', null, null, null, '<p style=\"text-align:justify\">2015年7月4日至2015年8月30日，中山大道（南京路至黄石路）将全封闭进行地铁区间工程施工。为保障施工路段周边道路安全、畅通和施工顺利进行，根据《中华人民共和国道路交通安全法》等法律法规的规定，现将该路段施工期间有关道路交通管理事项通告如下：</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 一、中山大道（南京路至黄石路）禁止机动车通行。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 二、保华街（黄石路至南京路）临时调整为双向通行。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 三、需通行施工路段的机动车，可绕行江汉二路、吉庆街、保华街、南京路、崇善路等相关道路。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 四、通行施工路段公交线路的调整，按照《武汉市城市公共客运交通管理条例》的规定，另行通告。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 五、机动车驾驶人应服从交通警察及现场管理人员的指挥，按照交通标志的指示通行。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 六、违反本通告的，公安机关交通管理部门将依照《中华人民共和国道路交通安全法》等有关法律、法规的规定，予以处罚。</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp; 特此通告。</p>\r\n', '2015-07-06 17:23:45', null, '3', '关于中山大道（南京路至黄石路）地铁6号线区间工程施工期间交通管理的通', null, '2015-07-06 17:23:50', '1');
