wtext;border-right:1px solid windowtext;border-top:none\" nowrap=\"\" valign=\"center\" width=\"97\"><p style=\";text-align:center;line-height:33px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">获</span></p><p style=\";text-align:center;line-height:33px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">得</span></p><p style=\";text-align:center;line-height:33px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">奖</span></p><p style=\";text-align:center;line-height:33px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">励</span></p><p style=\";text-align:center;line-height:33px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">或</span></p><p style=\";text-align:center;line-height:33px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">表</span></p><p style=\";text-align:center;line-height:33px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">彰</span></p><p style=\";text-align:center;line-height:33px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">情</span></p><p style=\";text-align:center;line-height:33px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">况</span></p></td><td colspan=\"2\" style=\"width:566px;padding:0 7px 0 7px ;border-left:none\" nowrap=\"\" valign=\"top\" width=\"566\"><p style=\"text-indent:37px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:19px\">要求：请注明近5年获得奖励或表彰的时间、名称以及级别等。获得的奖励或表彰仅限于</span><span style=\";font-family:仿宋_GB2312;color:rgb(51,51,51);font-weight:bold;font-size:19px\">劳模；会计先进工作者；行业、系统先进工作者</span><span style=\";font-family:仿宋_GB2312;color:rgb(51,51,51);font-weight:bold;font-size:21px\">（审原件，提供复印件）</span></p><p><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">&nbsp;</span></p><p><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">&nbsp;</span></p><p><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">&nbsp;</span></p><p><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">&nbsp;</span></p><p><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">&nbsp;</span></p></td><td width=\"2\"><br/></td></tr><tr style=\"height:245px\"><td width=\"0\"><br/></td><td style=\"width:97px;padding:0 7px 0 7px ;border-left:1px solid windowtext;border-right:1px solid windowtext;border-top:none\" nowrap=\"\" valign=\"center\" width=\"97\"><p style=\";text-align:center;line-height:27px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">参</span></p><p style=\";text-align:center;line-height:27px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">与</span></p><p style=\";text-align:center;line-height:27px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">重</span></p><p style=\";text-align:center;line-height:27px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">大</span></p><p style=\";text-align:center;line-height:27px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">项</span></p><p style=\";text-align:center;line-height:27px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">目</span></p><p style=\";text-align:center;line-height:27px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">情</span></p><p style=\";text-align:center;line-height:27px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">况</span></p></td><td colspan=\"2\" style=\"width:566px;padding:0 7px 0 7px ;border-left:none\" nowrap=\"\" valign=\"top\" width=\"566\"><p style=\"text-indent:42px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">要求：请说明参与市级以上重大项目可行性研究报告的时间、级别、名称、担任角色或职责等（</span><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">另附材料</span><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">）</span></p></td><td width=\"2\"><br/></td></tr><tr style=\"height:913px\"><td width=\"0\"><br/></td><td colspan=\"3\" style=\"width:663px;padding:0 7px 0 7px ;border-left:1px solid windowtext;border-right:1px solid windowtext;border-top:none\" nowrap=\"\" valign=\"center\" width=\"663\"><p style=\";text-align:center\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">&nbsp;</span></p><p style=\";text-align:center\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">主要工作业绩</span></p><p style=\";text-align:center\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">（2000字以内，另附材料）</span></p><p style=\";text-align:left\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">&nbsp;</span></p><p style=\"text-indent:43px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">要求：实事求是，客观反映本人</span><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">近5年</span><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">以来在单位工作中取得的主要工作业绩。文字表述流畅，层次清晰，条理分明。</span></p><p style=\"text-indent:42px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">1、能够正确贯彻执行国家相关法律、法规、规章、准则、制度等，有较强的会计专业理论和相关专业知识，为本行业或本单位经济发展和改革提供决策咨询服务，取得显著成绩；</span></p><p style=\"text-indent:42px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">2、主持市级以上重点工程、技术项目、重大经济建设项目的经济可行性论证，项目咨询及项目审计，取得显著的经济效益；在行业工作的专业分析、职业判断、创新能力方面发挥作用，能解决实务工作中复杂、疑难问题；</span></p><p style=\"text-indent:42px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">3、主持或为主参与行业或单位管理的具体实施办法，制定各项内部控制制度，具备在行业或单位实施内部控制制度的能力；</span></p><p style=\"text-indent:42px;text-align:left\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">4、组织指导较大规模的专业技术服务。承办有较大影响的审计项目（近3年达5个项目），为大中型企业提供管理及内控咨询（近3年达5家），为行业管理作出贡献；</span></p><p style=\"text-indent:42px;text-align:left\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">5、其他。</span></p><p style=\"text-indent:343px;text-align:left\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p></td><td width=\"2\"><br/></td></tr><tr style=\"height:186px\"><td colspan=\"3\" style=\"width:101px;padding:0 7px 0 7px ;border-left:1px solid windowtext;border-right:1px solid windowtext;border-top:none\" valign=\"center\" width=\"100\"><p style=\";text-align:center;line-height:29px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">申</span></p><p style=\";text-align:center;line-height:29px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">报</span></p><p style=\";text-align:center;line-height:29px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">人</span></p><p style=\";text-align:center;line-height:29px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">承</span></p><p style=\";text-align:center;line-height:29px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">诺</span></p></td><td colspan=\"2\" style=\"width:566px;padding:0 7px 0 7px ;border-left:none\" valign=\"center\" width=\"566\"><p><span style=\"font-family:&#39;MS Mincho&#39;;font-size:14px\">‍</span></p><p style=\"text-indent:43px;text-align:left\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">本人提供的全部个人材料真实，诚实守信，无违纪、违法记录。否则愿承担相应责任。</span></p><p><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:19px\">&nbsp;</span></p><p style=\"text-indent:83px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:19px\">申报人签字：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;年&nbsp;&nbsp;&nbsp;月&nbsp;&nbsp;&nbsp;日&nbsp;&nbsp;</span></p></td></tr><tr style=\"height:216px\"><td colspan=\"3\" style=\"width:101px;padding:0 7px 0 7px ;border-left:1px solid windowtext;border-right:1px solid windowtext;border-top:none\" valign=\"center\" width=\"100\"><p style=\";text-align:center;line-height:29px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">所</span></p><p style=\";text-align:center;line-height:29px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">在</span></p><p style=\";text-align:center;line-height:29px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">单</span></p><p style=\";text-align:center;line-height:29px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">位</span></p><p style=\";text-align:center;line-height:29px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">意</span></p><p style=\";text-align:center;line-height:29px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">见</span></p></td><td colspan=\"2\" style=\"width:566px;padding:0 7px 0 7px ;border-left:none\" valign=\"center\" width=\"566\"><p style=\"margin-right:75px;text-indent:101px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:19px\">&nbsp;</span></p><p style=\"margin-right:75px;text-indent:101px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:19px\">&nbsp;</span></p><p style=\"margin-right:75px;text-indent:101px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:19px\">&nbsp;</span></p><p style=\"margin-right:75px;text-indent:101px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:19px\">&nbsp;</span></p><p style=\"margin-right:75px;text-indent:28px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:19px\">负责人签字：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;单位盖章&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;年&nbsp;&nbsp;&nbsp;&nbsp;月&nbsp;&nbsp;&nbsp;日</span></p></td></tr><tr style=\"height:166px\"><td colspan=\"3\" style=\"width:101px;padding:0 7px 0 7px ;border-left:1px solid windowtext;border-right:1px solid windowtext;border-top:none\" valign=\"center\" width=\"100\"><p style=\";text-align:center;line-height:27px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">市高级</span></p><p style=\";text-align:center;line-height:27px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">会计人</span></p><p style=\";text-align:center;line-height:27px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">才专家</span></p><p style=\";text-align:center;line-height:27px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">评审委</span></p><p style=\";text-align:center;line-height:27px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">员会审</span></p><p style=\";text-align:center;line-height:27px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:21px\">核意见</span></p><p style=\"margin-right:75px;text-indent:101px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:19px\">&nbsp;</span></p></td><td colspan=\"2\" style=\"width:566px;padding:0 7px 0 7px ;border-left:none\" valign=\"center\" width=\"566\"><p style=\"margin-right:75px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:19px\">&nbsp;</span></p><p style=\"margin-right:75px\"><span style=\"font-family:仿宋_GB2312;font-weight:bold;font-size:19px\">&nbsp;</span></p><p style=\"margin-right:75px;margin-left:84px;text-indent:468px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font-size:19px\">&nbsp;负责人签字：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;年&nbsp;&nbsp;&nbsp;月&nbsp;&nbsp;&nbsp;日&nbsp;&nbsp;&nbsp;&nbsp;</span></p></td></tr><tr style=\"height:244px\"><td colspan=\"3\" style=\"width:101px;padding:0 7px 0 7px ;border-left:1px solid windowtext;border-right:1px solid windowtext;border-top:none\" valign=\"center\" width=\"100\"><p style=\";text-align:center;line-height:23px\"><span style=\";font-family:仿宋_GB2312;font-weight:bold;font