INSERT INTO `wechat_msgbean_msg` VALUES ('52', '在本篇教程中，我们假定您已经安装好Scrapy。 如若不然，请参考 安装指南 。接下来以 Open Directory Project(dmoz) (dmoz) 为例来讲述爬取。篇教程中将带您完成下列任务:创建一个Scrapy项目定义提取的Item编写爬取网站的 spider 并提取 Item编写 Item Pipeline 来存储提取到的Item(即数据)Scrapy由 Python 编写。如果您刚接触并且好奇这门语言的特性以及Scrapy的详情， 对于已经熟悉其他语言并且想快速学习Python的编程老手， 我们推荐 Learn Python The Hard Way ， 对于想从Python开始学习的编程新手， 非程序员的Python学习资料列表 将是您的选择。', '在本篇教程中，我们假定您已经安装好Scrapy', 'http://pic14.nipic.com/20110522/7411759_164157418126_2.jpg', 'Python开始学习的编程新手', 'a32ff248-b89e-4c45-8fef-18c89deb0bf8', 'b7d87928-35e4-4ca7-a563-75ceb2717482');
